create table MOVIE (
	Movie_id SERIAL NOT NULL PRIMARY KEY,
	Movie_title VARCHAR(100) NOT NULL,
	Type VARCHAR(20) NOT NULL,
	Parent_id INT,
	Series_number INT,
	Is_adult boolean NOT NULL,
	Director_first_name VARCHAR(150),
	Director_last_name VARCHAR(150),
	Start_year DATE,
	Runtime INT
);


